import React from "react";
import "../home/project.css";
import logo from "../../assets/img/logo-choira.svg";
import o4 from "../../assets/img/o4.png";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/effect-coverflow";
import "swiper/css/navigation";
import "swiper/css/pagination";

import { EffectCoverflow, Navigation, Pagination } from "swiper";
import img1 from "../../assets/img/sliderImg/img1.png";
import img2 from "../../assets/img/sliderImg/img2.png";
import img3 from "../../assets/img/sliderImg/img3.png";
import img4 from "../../assets/img/sliderImg/img4.png";
import img5 from "../../assets/img/sliderImg/img5.png";

function Project() {
  function nextSlide() {
    const currentSlide = document.querySelector('input[name="slider"]:checked');
    const nextSlide =
      currentSlide.nextElementSibling ||
      document.querySelector('input[name="slider"]:first-of-type');

    nextSlide.checked = true;
  }

  function prevSlide() {
    const currentSlide = document.querySelector('input[name="slider"]:checked');
    const prevSlide =
      currentSlide.previousElementSibling ||
      document.querySelector('input[name="slider"]:last-of-type');

    prevSlide.checked = true;
  }

  return (
    <>
      <div
        className="wrapper"
        style={{ backgroundImage: "url(images/image-17.png)" }}
      >
        {/* <div className="overlay"></div> */}
        <div className="navbar">
          <div>
            <img src={logo} alt="Choira Logo" style={{ cursor: "pointer" }} />
          </div>
          <div className="list">
            <h3>Home</h3>
            <h3>Soundtracks</h3>
            <h3>Jam</h3>
            <h3>Projects</h3>
            <h3>Signin</h3>

            <img className="o4" src={o4} alt="" />
          </div>
        </div>
        <div className="main">
          <section id="slider">
            {/* Radio buttons for navigation */}
            <input type="radio" name="slider" id="s1" checked />
            <input type="radio" name="slider" id="s2" />
            <input type="radio" name="slider" id="s3" />
            <input type="radio" name="slider" id="s4" />
            <input type="radio" name="slider" id="s5" />

            {/* Slide labels with images */}
            <label htmlFor="s1" id="slide1">
              <div>
                <img
                  src="https://i.pinimg.com/originals/2b/de/de/2bdede0647e3cdf75b44ea33723201d9.jpg"
                  alt="Slide 1"
                />
              </div>
            </label>
            <label htmlFor="s2" id="slide2">
              <img
                src="https://images6.alphacoders.com/462/thumb-1920-462371.jpg"
                alt="Slide 2"
              />
            </label>
            <label htmlFor="s3" id="slide3">
              <img
                src="https://wallpaperaccess.com/full/1154341.jpg"
                alt="Slide 3"
              />
            </label>
            <label htmlFor="s4" id="slide4">
              <img
                src="https://wallpapercave.com/wp/wp2634222.jpg"
                alt="Slide 4"
              />
            </label>
            <label htmlFor="s5" id="slide5">
              <img
                src="https://images5.alphacoders.com/343/thumb-1920-343645.jpg"
                alt="Slide 5"
              />
            </label>

            {/* Previous and Next buttons */}
            <button onClick={prevSlide}>Previous</button>
            <button onClick={nextSlide}>Next</button>
          </section>
        </div>
      </div>
    </>
  );
}

export default Project;
